import React from "react";
import Drink from "./Drink";

export default function DrinkList({drinks, onUpdateDrink, onDeleteDrink}){
  return(
    <div >
      <h2>Drinks</h2>
        {drinks.map(drink => (
          <Drink 
            key={drink.id} 
            drink={drink} 
            onDeleteDrink={onDeleteDrink}
            onUpdateDrink={onUpdateDrink}
          />
        ))}
    </div>
  )
}
